import axios from "axios";

function getTimes(){
    axios.get('localhost:8080/rest/dates').then((Response)=>{
        return Response.data
    }).catch((Error)=>{
        console.log(Error);
    })
}

function getKeywords(time){
    axios.get(`localhost:8080/rest/keywords?t=${time}`).then((Response) => {
        return Response.data
    }).catch((Error) => {
        console.log(Error);
    })
}

function getNews(time, keywords){
    axios.get(`localhost:8080/rest/news?t=${time}&keywords=${keywords}`).then((Response) => {
        return Response.data
    }).catch((Error) => {
        console.log(Error);
    })
}


export default {getTimes, getKeywords, getNews}
